--
-- Name: v_assess_dtl; Type: VIEW; Schema: public; Owner: tkms_user
--

CREATE VIEW public.v_assess_dtl AS
 SELECT h.constr_site_cd,
    h.assess_ym,
    d.partner_vendor_cd,
    d.major_work_cd,
    d.minor_work_cd,
    d.work_seq_no,
    d.spec,
    d.po_no,
    d.mtd_assess_amt,
    d.mtd_payment_amt,
    dtf.mtd_de_amt,
    sum(dt.mtd_assess_amt) AS bef_assess_total_amt,
    sum(dt.mtd_payment_amt) AS bef_payment_total_amt
   FROM (((((public.t_assess_hdr h
     JOIN public.t_assess_dtl d ON (((d.assess_hid = h.assess_hid) AND (d.del_flg = '0'::bpchar))))
     LEFT JOIN public.t_assess_hdr ht ON ((((ht.constr_site_cd)::text = (h.constr_site_cd)::text) AND ((ht.assess_ym)::text < (h.assess_ym)::text) AND (ht.newest_flg = '1'::bpchar) AND (ht.del_flg = '0'::bpchar))))
     LEFT JOIN public.t_assess_dtl dt ON (((dt.assess_hid = ht.assess_hid) AND ((dt.partner_vendor_cd)::text = (d.partner_vendor_cd)::text) AND ((dt.major_work_cd)::text = (d.major_work_cd)::text) AND ((dt.minor_work_cd)::text = (d.minor_work_cd)::text) AND ((dt.work_seq_no)::text = (d.work_seq_no)::text) AND ((dt.po_no)::text = (d.po_no)::text) AND (dt.del_flg = '0'::bpchar))))
     LEFT JOIN public.t_assess_hdr htf ON ((((htf.constr_site_cd)::text = (h.constr_site_cd)::text) AND ((htf.assess_ym)::text = (( SELECT hs.assess_ym
           FROM public.t_assess_hdr hs
          WHERE (((hs.constr_site_cd)::text = (h.constr_site_cd)::text) AND ((hs.assess_ym)::text < (h.assess_ym)::text))
          ORDER BY hs.assess_ym DESC
         LIMIT 1))::text) AND (htf.newest_flg = '1'::bpchar) AND (htf.del_flg = '0'::bpchar))))
     LEFT JOIN public.t_assess_dtl dtf ON (((dtf.assess_hid = htf.assess_hid) AND ((dtf.partner_vendor_cd)::text = (d.partner_vendor_cd)::text) AND ((dtf.major_work_cd)::text = (d.major_work_cd)::text) AND ((dtf.minor_work_cd)::text = (d.minor_work_cd)::text) AND ((dtf.work_seq_no)::text = (d.work_seq_no)::text) AND ((dtf.po_no)::text = (d.po_no)::text) AND (dtf.del_flg = '0'::bpchar))))
  WHERE ((h.newest_flg = '1'::bpchar) AND (h.del_flg = '0'::bpchar))
  GROUP BY h.constr_site_cd, h.assess_ym, d.partner_vendor_cd, d.major_work_cd, d.minor_work_cd, d.work_seq_no, d.spec, d.po_no, d.mtd_assess_amt, d.mtd_payment_amt, dtf.mtd_de_amt;


