--

CREATE VIEW public.v_login_account AS
 SELECT ml.login_id,
    ml.account_k,
    me.emp_id AS acctout_id,
    me.emp_cd AS account_cd,
    me.emp_nm AS account_nm,
    me.emp_kn_nm AS account_kn_nm,
    me.use_time_control_flg
   FROM (public.m_login ml
     JOIN public.m_emp me ON ((((me.login_id)::text = (ml.login_id)::text) AND (me.del_flg = '0'::bpchar) AND (me.newest_flg = '1'::bpchar))))
UNION ALL
 SELECT ml.login_id,
    ml.account_k,
    mv.vendor_id AS acctout_id,
    mv.partner_vendor_cd AS account_cd,
    ((mv.comp_nm || ' '::text) || mv.branch_nm) AS account_nm,
    ((mv.comp_kn_nm || ' '::text) || mv.branch_kn_nm) AS account_kn_nm,
    '2'::bpchar AS use_time_control_flg
   FROM (public.m_login ml
     JOIN public.m_vendor mv ON ((((mv.login_id)::text = (ml.login_id)::text) AND (mv.del_flg = '0'::bpchar) AND (mv.newest_flg = '1'::bpchar))))
UNION ALL
 SELECT ml.login_id,
    ml.account_k,
    mw.worker_id AS acctout_id,
    mw.worker_cd AS account_cd,
    mw.worker_nm AS account_nm,
    mw.worker_kn_nm AS account_kn_nm,
    '2'::bpchar AS use_time_control_flg
   FROM (public.m_login ml
     JOIN public.m_worker mw ON ((((mw.login_id)::text = (ml.login_id)::text) AND (mw.del_flg = '0'::bpchar) AND (mw.newest_flg = '1'::bpchar))));


