--

CREATE VIEW public.v_subbie_vendor_rel AS
 WITH RECURSIVE v_subbie_vendor_cte AS (
         SELECT t2.pri_partner_vendor_cd,
            t1.subbie_vendor_id,
            t1.partner_vendor_cd,
            t1.parent_subbie_vendor_id,
            NULL::character varying AS parent_partner_vendor_cd,
            1 AS level
           FROM (public.t_subbie_vendor_rel t1
             JOIN public.t_subbie_hdr t2 ON (((t2.subbie_hid = t1.subbie_hid) AND (t2.del_flg = '0'::bpchar))))
          WHERE ((t1.parent_subbie_vendor_id IS NULL) AND (t1.del_flg = '0'::bpchar))
        UNION ALL
         SELECT s2.pri_partner_vendor_cd,
            s1.subbie_vendor_id,
            s1.partner_vendor_cd,
            s1.parent_subbie_vendor_id,
            r1.partner_vendor_cd AS parent_partner_vendor_cd,
            (r1.level + 1) AS level
           FROM ((public.t_subbie_vendor_rel s1
             JOIN public.t_subbie_hdr s2 ON (((s2.subbie_hid = s2.subbie_hid) AND (s2.del_flg = '0'::bpchar))))
             JOIN v_subbie_vendor_cte r1 ON ((r1.subbie_vendor_id = s1.parent_subbie_vendor_id)))
          WHERE (s1.del_flg = '0'::bpchar)
        )
 SELECT pri_partner_vendor_cd,
    subbie_vendor_id,
    partner_vendor_cd,
    parent_subbie_vendor_id,
    parent_partner_vendor_cd,
    level
   FROM v_subbie_vendor_cte;


