--

CREATE VIEW public.v_wf_appr AS
 SELECT t_wf_appr_step.appr_st,
    t_wf_request.wf_request_id,
    t_wf_request.business_type_cd,
    t_wf_request.business_tbl_id,
    t_wf_request.business_data_id,
    t_wf_request.request_app_cd,
    t_wf_request.app_account_k,
    t_wf_request.current_step,
    t_wf_request.request_ts,
    t_wf_request.request_comment,
    t_wf_request.business_data_st,
    t_wf_request.final_appr_ts,
    t_wf_request.final_appr_emp_cd,
    t_wf_request.reg_ts AS wf_request_reg_ts,
    t_wf_appr_step.wf_appr_step_id,
    t_wf_appr_step.appr_step_order,
    t_wf_appr_step.appr_emp_cd,
    t_wf_appr_step.decision_ts,
    t_wf_appr_step.decision_comment
   FROM (public.t_wf_request
     JOIN public.t_wf_appr_step ON (((t_wf_appr_step.wf_request_id = t_wf_request.wf_request_id) AND (t_wf_appr_step.appr_step_order = t_wf_request.current_step) AND (t_wf_appr_step.del_flg = '0'::bpchar) AND (t_wf_appr_step.appr_st = '1'::bpchar))))
  WHERE ((t_wf_request.del_flg = '0'::bpchar) AND (t_wf_request.business_data_st = '2'::bpchar))
UNION
 SELECT t_wf_appr_step.appr_st,
    t_wf_request.wf_request_id,
    t_wf_request.business_type_cd,
    t_wf_request.business_tbl_id,
    t_wf_request.business_data_id,
    t_wf_request.request_app_cd,
    t_wf_request.app_account_k,
    t_wf_request.current_step,
    t_wf_request.request_ts,
    t_wf_request.request_comment,
    t_wf_request.business_data_st,
    t_wf_request.final_appr_ts,
    t_wf_request.final_appr_emp_cd,
    t_wf_request.reg_ts AS wf_request_reg_ts,
    t_wf_appr_step.wf_appr_step_id,
    t_wf_appr_step.appr_step_order,
    t_wf_appr_step.appr_emp_cd,
    t_wf_appr_step.decision_ts,
    t_wf_appr_step.decision_comment
   FROM (public.t_wf_request
     JOIN public.t_wf_appr_step ON (((t_wf_appr_step.wf_request_id = t_wf_request.wf_request_id) AND (t_wf_appr_step.del_flg = '0'::bpchar) AND (t_wf_appr_step.appr_st = ANY (ARRAY['2'::bpchar, '9'::bpchar])))))
  WHERE (t_wf_request.del_flg = '0'::bpchar);


ALTER VIEW public.v_wf_appr OWNER TO tkms_user;

